import React from "react";
import "./Card.css";
// import { Card1 } from "../../assets/card1.png";

const Card = () => {
  return (
    <div class="container">
      <div className="card">
        <img src="../../assets/card1.png" alt="" />
      </div>
      <div className="card"></div>
      <div className="card"></div>
    </div>
  );
};

export default Card;
